import React from 'react'
import './Navigation.css'
import Logo from './Logo'
import { useTranslation } from 'react-i18next';
import '../i18n'
import en from '../images/en.png'
import ru from '../images/ru.png'
import i18n from '../i18n';

const Navigation = () => {
	const { t } = useTranslation();
	const changeleLanguage = (lang) => (
		i18n.changeLanguage(lang)
	)
	return (
		<nav className='Navbar'>
			<Logo />
			<a href='#' className='Artificialintelligence'>{t("Navigation.Artificialintelligence")}</a>
			<a href='#' className='Home'>{t("Navigation.Home")}</a>
			<a href='#' className='About'>{t("Navigation.About")}</a>
			<a href='#' className='Services'>({t("Navigation.Services")})</a>
			<a href='#' className='Blog'>{t("Navigation.Blog")}</a>
			<a href='#' className='Contact'>{t("Navigation.Contact")}</a>
			<div className='England'><a href='http://localhost:3000/?lng=en'><img src={en} alt="en" /></a></div>
			<div className='Russia'><a href='http://localhost:3000/?lng=ru'><img src={ru} alt="ru" /></a></div>
			<btn className='Log_in'><a href=''> {t("Navigation.Log_in")}</a></btn>	
			<button onClick={()=> changeleLanguage("en")}>en </button>
		</nav>
	)
}
export default Navigation;
